import React, { Component} from 'react';
import $ from 'jquery';
import data from "../data"; 
const Api = ({ type = 'button', handleClick, children }) => {
  return (
    <main role="main">
		<div className="container">
			 <h3>APIs & Services</h3>
			 <p>Access information on how to use Forget APIs and Services</p>
		</div>
    </main>		
  );
};
export default Api;
